import{_ as a,c as i,o as r,aj as t}from"./chunks/framework.CtAXNf5e.js";const k=JSON.parse('{"title":"11 - 维基媒体","description":"","frontmatter":{},"headers":[],"relativePath":"储物间/11-维基媒体.md","filePath":"储物间/11-维基媒体.md","lastUpdated":1768715733000}'),o={name:"储物间/11-维基媒体.md"};function s(n,e,l,d,h,c){return r(),i("div",null,[...e[0]||(e[0]=[t('<h1 id="_11-维基媒体" tabindex="-1">11 - 维基媒体 <a class="header-anchor" href="#_11-维基媒体" aria-label="Permalink to &quot;11 - 维基媒体&quot;">​</a></h1><h2 id="_11-1-reference-参考" tabindex="-1">11.1 - Reference（参考） <a class="header-anchor" href="#_11-1-reference-参考" aria-label="Permalink to &quot;11.1 - Reference（参考）&quot;">​</a></h2><h3 id="wikipedia-维基百科" tabindex="-1">Wikipedia 维基百科 <a class="header-anchor" href="#wikipedia-维基百科" aria-label="Permalink to &quot;Wikipedia 维基百科&quot;">​</a></h3><p><a href="https://www.wikipedia.org/" target="_blank" rel="noreferrer">https://www.wikipedia.org/</a></p><p><strong>All the world’s knowledge 全世界的知识荟萃</strong></p><p>Wikipedia is a free, collaborative encyclopedia written in over 300 languages by volunteers around the world. 维基百科是一个自由的、协作的百科全书，由世界各地的志愿者用 300 多种语言编写。</p><h3 id="wikibooks-维基教科书" tabindex="-1">Wikibooks 维基教科书 <a class="header-anchor" href="#wikibooks-维基教科书" aria-label="Permalink to &quot;Wikibooks 维基教科书&quot;">​</a></h3><p><a href="https://www.wikibooks.org/" target="_blank" rel="noreferrer">https://www.wikibooks.org/</a></p><p><strong>E-book textbooks and annotated texts 电子教科书与注释文本</strong></p><p>Wikibooks aims to build a collection of free e-book resources including textbooks, annotated texts, instructional guides, and manuals. 维基教科书旨在构建一个自由的电子书资源库，其中包括教科书、注释文本、教学指南及手册。</p><h3 id="wiktionary-维基词典" tabindex="-1">Wiktionary 维基词典 <a class="header-anchor" href="#wiktionary-维基词典" aria-label="Permalink to &quot;Wiktionary 维基词典&quot;">​</a></h3><p><a href="https://www.wiktionary.org/" target="_blank" rel="noreferrer">https://www.wiktionary.org/</a></p><p><strong>A dictionary for over 170 languages 一部涵盖 170 多种语言的词典</strong></p><p>Wiktionary is a free multilingual dictionary. The project aims to describe all words of all languages. It includes language resources such as a thesaurus, rhyme guide, and language statistics. 维基词典是一本免费的多语言词典，该项目旨在解释所有语言的所有单词，包括同义词库、韵律指南和语言统计等诸多语言资源。</p><h3 id="wikiquote-维基语录" tabindex="-1">Wikiquote 维基语录 <a class="header-anchor" href="#wikiquote-维基语录" aria-label="Permalink to &quot;Wikiquote 维基语录&quot;">​</a></h3><p><a href="https://www.wikiquote.org/" target="_blank" rel="noreferrer">https://www.wikiquote.org/</a></p><p><strong>Find quotes across your favorite books, movies, authors and more 查找你喜欢的书籍、电影、作者等的名言</strong></p><p>Wikiquote is an online collection of sourced quotations from notable people and creative works in over 75 languages. It also includes proverbs, mnemonics and slogans. 维基语录是一个在线合集，收录了超过 75 种语言的知名人士之引言和创意作品，除此以外还包括各种谚语、助记(?)和口号。</p><h2 id="_11-2-collections-收藏集" tabindex="-1">11.2 - Collections（收藏集） <a class="header-anchor" href="#_11-2-collections-收藏集" aria-label="Permalink to &quot;11.2 - Collections（收藏集）&quot;">​</a></h2><h3 id="wikimedia-commons-维基共享资源" tabindex="-1">Wikimedia Commons 维基共享资源 <a class="header-anchor" href="#wikimedia-commons-维基共享资源" aria-label="Permalink to &quot;Wikimedia Commons 维基共享资源&quot;">​</a></h3><p><a href="https://commons.wikimedia.org/" target="_blank" rel="noreferrer">https://commons.wikimedia.org/</a></p><p><strong>(Over) 114 million images, photographs, videos and music files and counting 收录（超过）1.14 亿个图像、照片、视频和音乐文件，且数量持续增长中</strong></p><p>Wikimedia Commons is the world’s largest free-to-use library of illustrations, photos, drawings, videos, and music. 维基共享资源是世界上最大的「自由使用」媒体库，汇集了各类插图、照片、绘图、视频以及音乐。</p><h3 id="wikisource-维基文库" tabindex="-1">Wikisource 维基文库 <a class="header-anchor" href="#wikisource-维基文库" aria-label="Permalink to &quot;Wikisource 维基文库&quot;">​</a></h3><p><a href="https://wikisource.org/" target="_blank" rel="noreferrer">https://wikisource.org/</a></p><p><strong>The free library 自由的图书馆</strong></p><p>Wikisource is a library of freely-licensed source texts and historical documents, including poetry, government documents, constitutions of many countries, and general literature. 维基文库是一个包含自由版权原始文本和历史文档的图书馆，内容涵盖诗歌、政府公文、多国宪法以及普通文学作品。</p><h3 id="wikiversity-维基学院" tabindex="-1">Wikiversity 维基学院 <a class="header-anchor" href="#wikiversity-维基学院" aria-label="Permalink to &quot;Wikiversity 维基学院&quot;">​</a></h3><p><a href="https://www.wikiversity.org/" target="_blank" rel="noreferrer">https://www.wikiversity.org/</a></p><p><strong>Access learning resources, projects and research at any level of study 获取各级学习资源、项目和研究</strong></p><p>Wikiversity is devoted to learning resources, learning projects, and research for use in all levels, types, and styles of education. 维基学院致力于提供适用于各级、各类和各种教育风格的学习资源、学习项目及研究。</p><h3 id="wikispecies-维基物种" tabindex="-1">Wikispecies 维基物种 <a class="header-anchor" href="#wikispecies-维基物种" aria-label="Permalink to &quot;Wikispecies 维基物种&quot;">​</a></h3><p><a href="https://species.wikimedia.org/" target="_blank" rel="noreferrer">https://species.wikimedia.org/</a></p><p><strong>The free species directory 自由的物种目录</strong></p><p>Wikispecies is a species database for taxonomy that covers living and fossil representatives of Animalia, Plantae, Fungi, Bacteria, Archaea, Protista and all other forms of life. 维基物种是一个分类学物种数据库，涵盖了动物界、植物界、真菌界、细菌界、古菌界、原生生物界及所有其他生命形式的现存和化石代表。</p><h2 id="_11-3-technology-技术" tabindex="-1">11.3 - Technology（技术） <a class="header-anchor" href="#_11-3-technology-技术" aria-label="Permalink to &quot;11.3 - Technology（技术）&quot;">​</a></h2><h3 id="wikidata-维基数据" tabindex="-1">Wikidata 维基数据 <a class="header-anchor" href="#wikidata-维基数据" aria-label="Permalink to &quot;Wikidata 维基数据&quot;">​</a></h3><p><a href="https://www.wikidata.org/" target="_blank" rel="noreferrer">https://www.wikidata.org/</a></p><p><strong>The database of structured information collaboratively edited 协同编辑的结构化信息数据库</strong></p><p>Wikidata acts as central storage of structured data for Wikimedia projects. Structuring data into a machine-readable format makes it easier to view, search, edit, curate, use and re-use files. 维基数据充当维基媒体项目的结构化数据中央存储库。将数据结构化为机器可读格式，使其更易于查看、搜索、编辑、策展、使用和重复使用文件。</p><h3 id="wikifunctions-维基函数" tabindex="-1">Wikifunctions 维基函数 <a class="header-anchor" href="#wikifunctions-维基函数" aria-label="Permalink to &quot;Wikifunctions 维基函数&quot;">​</a></h3><p><a href="https://www.wikifunctions.org/" target="_blank" rel="noreferrer">https://www.wikifunctions.org/</a></p><p><strong>The library of code functions anyone can edit 人人皆可编辑的代码函数库</strong></p><p>Wikifunctions allows everyone to collaboratively create and maintain code functions that can be used to answer questions, such as how many days have passed between two dates, or the distance between two cities. 维基函数允许所有人协同创建和维护代码函数，这些函数可用于回答问题，例如两个日期之间过去了多少天，或两个城市之间的距离。</p><h3 id="mediawiki" tabindex="-1">MediaWiki <a class="header-anchor" href="#mediawiki" aria-label="Permalink to &quot;MediaWiki&quot;">​</a></h3><p><a href="https://www.mediawiki.org/" target="_blank" rel="noreferrer">https://www.mediawiki.org/</a></p><p><strong>The software platform that makes Wikipedia possible 成就维基百科的软件平台</strong></p><p>MediaWiki is free and open source wiki software that anyone can use and develop. It is the platform on which Wikimedia projects are built. MediaWiki 是任何人都可以使用和开发的免费开源 Wiki 软件。它是构建维基媒体项目的平台。</p><h2 id="_11-4-guides-指南" tabindex="-1">11.4 - Guides（指南） <a class="header-anchor" href="#_11-4-guides-指南" aria-label="Permalink to &quot;11.4 - Guides（指南）&quot;">​</a></h2><h3 id="wikivoyage-维基导游" tabindex="-1">Wikivoyage 维基导游 <a class="header-anchor" href="#wikivoyage-维基导游" aria-label="Permalink to &quot;Wikivoyage 维基导游&quot;">​</a></h3><p><a href="https://www.wikivoyage.org/" target="_blank" rel="noreferrer">https://www.wikivoyage.org/</a></p><p><strong>The ultimate travel guide 终极旅游指南</strong></p><p>Wikivoyage aims to create the world’s largest free, complete and up-to-date worldwide travel guide. 维基导游旨在创建世界上最大的免费、完整且最新的全球旅游指南。</p><h3 id="wikinews-维基新闻" tabindex="-1">Wikinews 维基新闻 <a class="header-anchor" href="#wikinews-维基新闻" aria-label="Permalink to &quot;Wikinews 维基新闻&quot;">​</a></h3><p><a href="https://www.wikinews.org/" target="_blank" rel="noreferrer">https://www.wikinews.org/</a></p><p><strong>The free news source 自由的新闻源</strong></p><p>Wikinews provides a free content alternative to commercial news sites with articles that are fact-checked and peer reviewed. 维基新闻提供了一种替代商业新闻网站的免费内容选择，其文章均经过事实核查和同行评审。</p><h2 id="_11-5-collaboration-协作" tabindex="-1">11.5 - Collaboration（协作） <a class="header-anchor" href="#_11-5-collaboration-协作" aria-label="Permalink to &quot;11.5 - Collaboration（协作）&quot;">​</a></h2><h3 id="meta-wiki-元维基" tabindex="-1">Meta-Wiki 元维基 <a class="header-anchor" href="#meta-wiki-元维基" aria-label="Permalink to &quot;Meta-Wiki 元维基&quot;">​</a></h3><p><a href="https://meta.wikimedia.org/wiki/Main_Page" target="_blank" rel="noreferrer">https://meta.wikimedia.org/wiki/Main_Page</a></p><p><strong>Project coordination software tool for global collaboration 全球协作的项目协调工具</strong></p><p>Meta-Wiki is a project used as a central hub for various coordination and organization tasks, such as discussions affecting multiple wikis or planning upcoming events. 元维基是一个用于各种协调和组织任务的中心枢纽项目，例如涉及多个维基的讨论或规划即将举行的活动。</p>',62)])])}const w=a(o,[["render",s]]);export{k as __pageData,w as default};
